window.bookSummaryJSON = "<p>From Hugo and Dragon Award finalist David VanDyke and million-selling science-fiction legend and Dragon Award finalist B. V. Larson comes book three in the epic military space opera adventure saga! </p> <p>Commodore Straker faces new enemies as neighboring interstellar empires decide his New Republic is a growing threat. A two-front war develops, and the Liberator must face both the Mutuality and the Hundred Worlds. </p> <p>Even as the fighting rages, the mysterious Opters are on the move. They make a diplomatic effort to reach out to Straker - but can he trust the Hive Masters? Will they help or stab him in the back? </p> <p><i>Flagship Victory</i> is a thrilling tale of warfare and adventure among the stars. This is the third book in the Galactic Liberation series. Look for book 1, <i>Starship Liberator</i>, if you're new to this expanding universe. </p>"; 
